import React, { useState, useEffect } from 'react';

function UseStateHook() {
  const [count, setCount] = useState(0)
  const [title] = useState('')

  useEffect(() => {
    title = `clicked ${count} times`;
  })

  return (
    <section>
      <p>{title}</p>
      <button onClick={() => setCount(count + 1)}>
        click
      </button>
    </section>
  );
}

export default UseStateHook;
